import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    // Get user from localStorage
    const userData = localStorage.getItem('user');
    if (userData) {
      setUser(JSON.parse(userData));
    } else {
      navigate('/login');
    }
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  if (!user) return null;

  // Render appropriate dashboard based on user role
  if (user.role === 'teacher') {
    return <TeacherDashboard user={user} onLogout={handleLogout} />;
  } else {
    return <StudentDashboard user={user} onLogout={handleLogout} />;
  }
};

// Teacher Dashboard Component
const TeacherDashboard = ({ user, onLogout }) => {
  return (
    <div className="min-h-screen bg-intel-light-gray">
      {/* Header */}
      <header className="bg-intel-blue shadow-md">
        <div className="container mx-auto px-4 py-4 flex justify-between items-center">
          <div className="flex items-center">
            <h1 className="text-white text-2xl font-bold">CoreMentis</h1>
            <span className="ml-2 text-white/80 text-sm">Engagement Analyzer</span>
          </div>
          <div className="flex items-center">
            <span className="text-white mr-4">Teacher: {user.name || user.email}</span>
            <button
              onClick={onLogout}
              className="bg-white text-intel-blue px-4 py-1 rounded hover:bg-gray-100 transition duration-300"
            >
              Logout
            </button>
          </div>
        </div>
      </header>

      {/* Main content */}
      <main className="container mx-auto px-4 py-8">
        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h2 className="text-2xl font-bold text-intel-dark-blue mb-4">Teacher Dashboard</h2>
          <p className="text-intel-dark-gray mb-4">
            Welcome to the teacher dashboard. Here you can monitor student engagement metrics and manage your classes.
          </p>
          <div className="bg-intel-light-gray p-4 rounded-md">
            <p className="font-medium">Powered by Intel® OpenVINO™ models:</p>
            <ul className="list-disc pl-5 mt-2 space-y-1">
              <li>Face Detection (face-detection-adas-0001)</li>
              <li>Emotions Recognition (emotions-recognition-retail-0003)</li>
              <li>Gaze Estimation (gaze-estimation-adas-0002)</li>
              <li>Facial Landmarks (facial-landmarks-35-adas-0002)</li>
              <li>Head Pose Estimation (head-pose-estimation-adas-0001)</li>
            </ul>
          </div>
        </div>

        {/* Placeholder for teacher-specific features */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h3 className="text-xl font-bold text-intel-dark-blue mb-4">Teacher Features Coming Soon</h3>
          <p className="text-intel-dark-gray">
            This dashboard will be updated with teacher-specific features as requested.
          </p>
        </div>
      </main>
    </div>
  );
};

// Student Dashboard Component
const StudentDashboard = ({ user, onLogout }) => {
  return (
    <div className="min-h-screen bg-intel-light-gray">
      {/* Header */}
      <header className="bg-intel-dark-blue shadow-md"> {/* Different color to distinguish from teacher */}
        <div className="container mx-auto px-4 py-4 flex justify-between items-center">
          <div className="flex items-center">
            <h1 className="text-white text-2xl font-bold">CoreMentis</h1>
            <span className="ml-2 text-white/80 text-sm">Engagement Analyzer</span>
          </div>
          <div className="flex items-center">
            <span className="text-white mr-4">Student: {user.name || user.email}</span>
            <button
              onClick={onLogout}
              className="bg-white text-intel-dark-blue px-4 py-1 rounded hover:bg-gray-100 transition duration-300"
            >
              Logout
            </button>
          </div>
        </div>
      </header>

      {/* Main content */}
      <main className="container mx-auto px-4 py-8">
        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h2 className="text-2xl font-bold text-intel-dark-blue mb-4">Student Dashboard</h2>
          <p className="text-intel-dark-gray mb-4">
            Welcome to the student dashboard. Here you can view your engagement metrics and access learning resources.
          </p>
          <div className="bg-intel-light-gray p-4 rounded-md">
            <p className="font-medium">Your engagement is analyzed using Intel® OpenVINO™ models:</p>
            <ul className="list-disc pl-5 mt-2 space-y-1">
              <li>Face Detection (face-detection-adas-0001)</li>
              <li>Emotions Recognition (emotions-recognition-retail-0003)</li>
              <li>Gaze Estimation (gaze-estimation-adas-0002)</li>
              <li>Facial Landmarks (facial-landmarks-35-adas-0002)</li>
              <li>Head Pose Estimation (head-pose-estimation-adas-0001)</li>
            </ul>
          </div>
        </div>

        {/* Placeholder for student-specific features */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h3 className="text-xl font-bold text-intel-dark-blue mb-4">Student Features Coming Soon</h3>
          <p className="text-intel-dark-gray">
            This dashboard will be updated with student-specific features as requested.
          </p>
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
